window.bookSummaryJSON = "<p>The gods live among us.</p> <p>I thought that the death of the man who tortured me, broke me, and then hunted me to the ends of the Earth would be the end of our fight; but it’s only the beginning.</p> <p>After thousands of years of being apart, our god bonds are reunited once again; and they’re not ready to go down without a fight.</p> <p>They’ve woken up hungry.</p> <p>All of the research in the world couldn’t have prepared us for what’s to come, enemies and wars fought over millennia. Now we’re being forced to act, but this time, we have the advantage.</p> <p>This time, we’re Bonded.</p> <p>Are we strong enough to survive the gods and their plans? Will we ever live in the peaceful world we’ve fought so hard for, or is history doomed to repeat itself?</p>"; 
